import React from 'react';
 
function Elemento(props) {
    return (
      <div>
          <a href="posts.html" className="list-group-item">
          <span className="glyphicon glyphicon-${props.icono}" aria-hidden="true"></span> {props.Titulo} 
          <span className="badge">{this.state.CantidadEvaluaciones.Terminadas}</span> {props.Cantidad}</a>
      </div>
    );
  }
  
export default Elemento;
